import React from 'react';
import {connect} from "react-redux";

const Scores = (props) => {
        return (
            <div className='scores'>
                <div>HELLO SCORES</div>
            </div>
        );
};

const mapStateToProps = (state) => ({
   name1: state.name1,
   name2: state.name2
});

export default connect(mapStateToProps)(Scores);
